import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Sidebar from "./Sidebar/Sidebar";

const Admin = () => {
  return (
    <>
      <Sidebar />
      <BrowserRouter>
        <Routes>
          <Route path="/admin/dashboard"></Route>
        </Routes>
      </BrowserRouter>
      <div className="test">adadadada</div>
    </>
  );
};

export default Admin;
